import React, {useRef,useState,useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import { Toast } from 'primereact/toast';
import { ScrollPanel } from 'primereact/scrollpanel';
import './assets/dist/css/bootstrap.min.css';
import './assets/dist/js/bootstrap.bundle.min';
import './assets/fontawesome-5/css/all.min.css';
import './assets/fontawesome-5/css/all.css';
import Header from './Header';


export default function Detail() {
  const [voitureDetails, setVoitureDetails] = useState(null);
    const toast = useRef(null);
    const location = useLocation();
    const searchParams = new URLSearchParams(location.search);
    const idVoiture = searchParams.get('idVoiture');
    const nom = searchParams.get('nom');

    useEffect(() => {
      const fetchData = async () => {
        try {
          const response = await fetch(`http://localhost:8081/api/voiture/findOne/${idVoiture}`);

          if (!response.ok) {
            throw new Error('Erreur lors de la récupération des détails de la voiture');
          }

          const data = await response.json();
          setVoitureDetails(data);
        } catch (error) {
          console.error('Erreur :', error.message);
        }
      };

      fetchData();
    }, [idVoiture]);

    const showSuccess = () => {
        toast.current.show({severity:'success', summary: 'Ajout', detail:'Annonce Accepter', life: 3000});
    }

    const showError = () => {
      toast.current.show({severity:'error', summary: 'Suppresion', detail:'Annonce Refuser', life: 3000});
  }

  if (!voitureDetails) {
    return <div>Loading wait...</div>;
  }


    return (
        <>
        <Header></Header>
        <Toast ref={toast} position="top-center" />
        {/* <h1>Détails de la voiture avec l'ID : {idVoiture}</h1> */}
        <div className='container-lg'>
        <div className="row p-4 pb-0 pe-lg-0 pt-lg-5 align-items-center">
        <div className="col-lg-7 p-3 p-lg-5 pt-lg-3">
          <ScrollPanel>
          <h1 className="display-4 fw-bold lh-1">{nom}</h1>
          <p className="lead">{voitureDetails.description_annonce}</p>
          <div className='py-4' ></div>
          <table className=' table table-responsive table-stripped' >
            <thead>
                <th> annee de mise en circulation:</th>
                <th className='text-end text-secondary'>{voitureDetails.detail.annee}</th>
            </thead>
            <tbody>
                <tr>
                    <td></td>
                    <td></td>
                </tr>
            </tbody>
          </table>
          <div className='py-3' ></div>
          <table className=' table table-responsive table-stripped' >
            <thead>
                <th>Boite de vitesse:</th>
                <th className='text-end text-secondary'>{voitureDetails.detail.boite_devitesse}</th>
            </thead>
            <tbody>
                <tr>
                    <td></td>
                    <td></td>
                </tr>
            </tbody>
          </table>

          <div className='py-3' ></div>
          <table className='table table-responsive table-stripped' >
            <thead>
                <th>Moteur</th>
                <th className='text-end text-secondary' >{voitureDetails.detail.source_energie}</th>
            </thead>
            <tbody>
                <tr>
                    <td></td>
                    <td></td>
                </tr>
            </tbody>
          </table>

          <div className='py-3' ></div>
          <table className='table table-responsive table-stripped' >
            <thead>
                <th>Couleur</th>
                <th className='text-end text-secondary' >{voitureDetails.detail.source_energie}</th>
            </thead>
            <tbody>
                <tr>
                    <td></td>
                    <td></td>
                </tr>
            </tbody>
          </table>

          <div className='py-3' ></div>
          <table className='table table-responsive table-stripped' >
            <thead>
                <th>Prix</th>
                <th className='text-end text-secondary' >{voitureDetails.prix}Ar</th>
            </thead>
            <tbody>
                <tr>
                    <td></td>
                    <td></td>
                </tr>
            </tbody>
          </table>
          </ScrollPanel>
          <div className='py-3' ></div>
          <div className="d-grid gap-2 d-md-flex justify-content-md-start mb-4 mb-lg-3">
            <button type="button" className="btn btn-success btn-lg px-4 me-md-2 fw-bold" onClick={showSuccess} ><i className='fas fa-check' ></i> Accepter</button>
            <button type="button" className="btn btn-danger btn-lg px-4 me-md-2 fw-bold" onClick={showError} ><i className='fas fa-times' ></i> Reffuser</button>
          </div>

        </div>
        <div className="col-lg-4 offset-lg-1 p-0 overflow-hidden">
            <img className="rounded-lg-3" src="https://images.caradisiac.com/logos/0/7/1/9/280719/S5-les-5-tendances-autos-du-ces-de-las-vegas-206446.jpg" alt="" width="720"/>
        </div>
      </div>
      </div>
      </>
    );
}
